import './App.css';
import Containers from './Containers';     ///extra line to use button  
const mathLib = require('./mathLib.js')

class App extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      showContainers: false,
      showContainer: false,
      value0: 0,
      value1: 0,
